    public dynamic class func drawCanvas1(frame targetFrame: CGRect = CGRect(x: 0, y: 0, width: 104, height: 104), resizing: ResizingBehavior = .aspectFit, bearing: UIImage) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()!
        
        //// Resize to Target Frame
        context.saveGState()
        let resizedFrame: CGRect = resizing.apply(rect: CGRect(x: 0, y: 0, width: 104, height: 104), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 104, y: resizedFrame.height / 104)


        //// bearingSlot 2 Drawing
        let bearingSlot2Path = UIBezierPath(ovalIn: CGRect(x: 0, y: 0, width: 104, height: 104))
        context.saveGState()
        bearingSlot2Path.addClip()
        context.translateBy(x: 0, y: 0)
        context.scaleBy(x: 1, y: -1)
        context.translateBy(x: 0, y: -bearing.size.height)
        context.draw(bearing.cgImage!, in: CGRect(x: 0, y: 0, width: bearing.size.width, height: bearing.size.height))
        context.restoreGState()
        
        context.restoreGState()

    }

